import React, { useState, useEffect } from "react";
import { Routes, Route, Navigate, Outlet, useLocation } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import ProductDetails from "./pages/ProductDetails";
import Cart from "./pages/Cart";
import Login from "./pages/Login";
import Wishlist from "./pages/Wishlist";
import Profile from "./pages/Profile";
import Checkout from "./pages/Checkout";
import Categories from "./pages/Categories";
import About from "./pages/About";
import Contact from "./pages/Contact";


const ProtectedRoute = () => {
  const user = JSON.parse(localStorage.getItem("user"));
  return user ? <Outlet /> : <Navigate to="/login" replace />;
};

const App = () => {
  const [cart, setCart] = useState([]);
  const location = useLocation(); 
  const navigate = useNavigate(); // Hook for navigation
  const user = JSON.parse(localStorage.getItem("user")); // Get user data from localStorage

  useEffect(() => {
    const storedCart = JSON.parse(localStorage.getItem("cart"));
    if (storedCart) setCart(storedCart);
  }, []);

  useEffect(() => {
    localStorage.setItem("cart", JSON.stringify(cart));
  }, [cart]);

  useEffect(() => {
    // If the user is logged in, redirect them to the appropriate page based on their role
    if (user) {
      switch (user.role) {
        case "admin":
          navigate("/admin/dashboard"); // Admin dashboard
          break;
        case "landlord":
          navigate("/landlord/dashboard"); // Landlord dashboard
          break;
        case "tenant":
          navigate("/tenant/dashboard"); // Tenant dashboard
          break;
        default:
          break;
      }
    }
  }, [user, navigate]);

  const shouldDisplayNavbar = !["/login", "/register"].includes(location.pathname);

  return (
    <>
      {/* Show Navbar unless on login or register page */}
      {shouldDisplayNavbar && <Navbar user={user} cart={cart} />}

      <Routes>
        {/* Routes for Login and Register */}
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* Protected Routes (Requires User to be Logged in) */}
        <Route element={<ProtectedRoute />}>
          <Route path="/" element={<Home />} />
          <Route path="/product/:id" element={<ProductDetails />} />
          <Route path="/cart" element={<Cart cart={cart} setCart={setCart} />} />
          <Route path="/wishlist" element={<Wishlist />} />
          <Route path="/profile" element={<Profile />} />
          <Route path="/checkout" element={<Checkout />} />
          <Route path="/categories" element={<Categories cart={cart} setCart={setCart} />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />
        </Route>

        {/* Admin Routes */}
        {user?.role === "admin" && (
          <>
            <Route path="/admin/dashboard" element={<div>Admin Dashboard</div>} />
            <Route path="/admin/registration-requests" element={<div>Admin: Registration Requests</div>} />
            <Route path="/admin/post-requests" element={<div>Admin: Post Approval Requests</div>} />
          </>
        )}

        {/* Landlord Routes */}
        {user?.role === "landlord" && (
          <>
            <Route path="/landlord/dashboard" element={<div>Landlord Dashboard</div>} />
            <Route path="/landlord/properties" element={<div>Landlord: Manage Properties</div>} />
            <Route path="/landlord/new-property" element={<div>Landlord: Upload New Property</div>} />
            <Route path="/landlord/favorites" element={<div>Landlord: Favorites</div>} />
            <Route path="/landlord/profile" element={<div>Landlord: Profile</div>} />
          </>
        )}

        {/* Tenant Routes */}
        {user?.role === "tenant" && (
          <>
            <Route path="/tenant/dashboard" element={<div>Tenant Dashboard</div>} />
            <Route path="/tenant/properties" element={<div>Tenant: View Properties</div>} />
            <Route path="/tenant/favorites" element={<div>Tenant: Favorites</div>} />
            <Route path="/tenant/profile" element={<div>Tenant: Profile</div>} />
          </>
        )}
      </Routes>
    </>
  );
};

export default App;
